import React from 'react';

class Coffees extends React.Component {
    render () {
        return (
  <div className="title">
  <h2 className="pull-left">
    <span className="title-border">
      <i className="icon icon-star" />
    </span>
    Popüler Dizilerden Son Bölümler
  </h2>
</div>


        )
    }
}

export default Coffees;
